  false,\n\t\"url\": null,\n\t\"notes\": \"Increasing amounts of atmospheric carbon
  dioxide from human industrial activities are causing changes in global ocean carbon
  chemistry resulting in a reduction in pH, a process termed ocean acidification.
  Studies have demonstrated adverse effects on calcifying organisms, particularly
  some invertebrates, corals, sea urchins, pteropods, and coccolithophores. This effort
  is in support of the coastal monitoring and research objectives of the NOAA Ocean
  Acidification Program (OAP).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
